  }));
};

UilQuestionCircle.propTypes = {
  color: PropTypes.string,
  size: PropTypes.oneOfType([PropTypes.string, PropTypes.number]),
};

UilQuestionCircle.defaultProps = {
  color: 'currentColor',
  size: '24',
};

export default UilQuestionCircle;
